    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * - ( + col1 ) + 2 NOT BETWEEN ( 10 * col0 ) AND NULL;
  - name: tab1

outputs:
  - name: q12360.out
    data: |
      51	14	96
      85	5	59
      91	47	68
